import React from "react";
import Layout from "../Layout";
import picture from "../../assets/images/me.jpg";
import "./About.css";

const AboutPage = () => {
  return (
    <Layout>
      <div className="About">
        <h1>About Me</h1>
        <div className="AboutSection">
          <img src={picture} alt="" />
          <div className="AboutInfo"></div>
        </div>
      </div>
    </Layout>
  );
};

export default AboutPage;
